VALUES ('0621498005195', 'Cereales petit dejeuner arome miel noix', '*Protéine de soja, farine de soja, farine de riz, maltodextrine de maïs, huile de tournesol, épaississant: E414, arôme (1 édulcorant: E955. Traces de produits à base de cacahuètes, de noix, de graines, de lait, d\'oeuf et blé. * Ingrédient fait à partir de soja ou maïs génétiquement modifié. Mode d\'emploi: Verser le contenu d\'un sachet dans 125 ml de lait écrémé. Ingrediënten: *Sojaproteïne, sojameel, rijstmeel, gerstmoutextract, zonnebloemolie, bindmiddel: E414, smaakstof (1,9%), zoetstof: E955. Sporen van pinda\'s, noten, zaden, melk, eieren en op tanve gebaseerde producten. * Ingrediënten gemaakt met genetisch gemodificeerde maïs en soja. Instructies: Giet de inhoud van een zak in 125 ml magere melk. Ingredients: *Soy protein, soy flour, rice flour, corn maltodextrine, sunflower oil, thickener: E414, flavour (119%), sweetener: E955. Traces of peanuts, nuts, seeds, milk, egg and wheat-based product. * Ingredients made With genetically modified corn or soy. Directions: Pour contents of one pouch in 125 ml of skim mlik. Ingredientes: *Proteina de soja, harina de soja, harina de arroz, maltodextrina de maiz, aceite de girasol, espesante: E414, sabor (1,9%), edulcorante: E955. Rastros de productos a base de cacahuetes, frutos secos, semillas, leche, huevo y trigo. * Ingredientes fabricados a partir de soja o maïz genéticamente modificado. Modo de empleo: Vertir el contenido de un sobre en 125 ml de leche desnatada.', 'https://static.openfoodfacts.org/images/products/062/149/800/5195/front_fr.4.400.jpg', '11', '0.8', '15', '7.6', '6', '60', '0.03', '0.0118110236220472', '', '1');

