VALUES ('0625020362992', 'combo', 'Dalisa 26 Saucisses conservées non cuites combo 6 saveurs 26 Preserved sausages uncooked combo 6 flavours Mode de cuisson : Cuire à feux doux, dans une poêle, de 12 à 15 minutes ou jusqu\'à une température interne de 71 °C (160 °F) Cooking instruction: Cook on low heat, in a pan, 12 to 15 minutes or until an internal temperature of 71 °C (160 °F) Ingrédients: Chair à saucisse : porc, eau, chapelure de blé grillée, farine de soya, sel, épices, vinaigre en poudre, érythorbate de sodium, assaisonnement italienne (farine de blé, oignon déshydraté, sucre, ail déshydraté), assaisonnement Toulouse (fécule de tapioca, ail en poudre, extrait de levure), assaisonnement bacon cheddar (fromage cheddar, bacon, farine de blé, substances laitières modifiées, oignons déshydratés, saveur naturelle, saveur de fumée), assaisonnement vin blanc et échalotes (fécule de tapioca, légumes déshydratés (oignon vert, ail, oignon), vin blanc en poudre (maltodextrine de blé), extrait de levure (sel), levure de bière (blé, orge)), assaisonnement mexicaine (légumes déshydratés (poivron rouge, ail, tomate, poivron vert, oignon), jalapeno déshydraté, sucre), assaisonnement jambon et érable (jambon, sucre, cassonade, fécule de tapioca, sucre d\'érable, saveur naturelle et artificielle, extrait de levure), boyau végétal (alginate de calcium). Contient: Blé, orge, soya, lait Ingredients: Sausage meat pork, water, toasted wheat crumbs, soy flour, salt, spices, dried vinegar, sodium erythorbate, Italian seasoning (wheat flour, dehydrated onion, sugar, dehydrated garlic), Toulouse seasoning (tapioca starch, garlic powder, yeast extract), cheddar bacon seasoning (cheddar cheese, bacon, wheat flour, modified milk ingredients, dehydrated onion, natural flavour, smoke flavour), white wine and shallots seasoning (tapioca starch, dehydrated vegetables (green onion, garlic, onion), white wine powder (wheat maltodextrin), yeast extract (salt), brewers yeast (wheat, barley)), Mexican seasoning (dehydrated vegetables (red bell pepper, garlic, tomato, green bell pepper, onion), dehydrated jalapeno, sugar), ham and maple seasoning (ham, sugar, brown sugar, tapioca starch, maple sugar, natural and artificial flavour, yeast extract), vegetable casing (calcium alginate). Contains: Wheat, barley, soy, milk Code 2', 'https://static.openfoodfacts.org/images/products/062/502/036/2992/front_fr.4.400.jpg', '17.7', '6.25', '6.25', '1.04', '1.04', '13.5', '0.646', '0.254', '', '1');

